import React, {useState} from 'react'

export default function GetTest({props}) {
    const[task, setTask] = useState(111);
    function updateTask() {
        fetch('https://mypew.ru/php/table.php', {
            method: 'POST',
            header: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                table : 3,
                date : props.date,
                day_count: 1,
            })
        })
        .then (res => res.json())
        .then ((response) => {
           return (response)
        })
      }
  return (
    <div>{task}</div>
  )
}
